import React from "react"

function PrikazSvihKorisnika(props){
    return(
            <tr>
                <td>{props.user.korisnickoIme}<button style={{marginLeft: "15px", color: "blue"}} onClick={props.handleClick} name={props.user.korisnickoIme}>Prikazi korisnika</button></td>
                <td>{props.user.datumRegistracije}</td>
                <td style={{textAlign: "center"}}>{props.user.authorities}</td>
            </tr>
    )
}

export default PrikazSvihKorisnika
